import { useState } from "react";

function App() {
  const [num, setNum] = useState(0);

  return (
    <>
      <span>{num}</span>
      <button
        onClick={() => {
          setNum(num + 1);
        }}
      >
        +
      </button>
    </>
  );
}

export default App;
